import React,{Component} from 'react'
import Navbar from'./navbar'
import Jumbotron from './jumbotron'
import Card from "./card";
import Left from "./left";


class App extends Component{
    render() {
        return(
            <div>
                <Navbar/>
                
                <div className="container">
                    <div className="row">
                        <div className="col-4"><Left/></div>
                        <div className="col-8">
                            <div className="col-3"><Card title={"Product #1"}/></div>
                            <div className="col-3"><Card title={"Product #2"}/></div>
                            <div className="col-3"><Card title={"Product #3"}/></div>

                            <div className="col-3"><Card title={"Product #4"}/></div></div>



                    </div>
                </div>



            </div>
        )
    }
}

export default App
